import React from "react";
import Heading from "./Heading";
import Input from "./Input";
export default LogInForm;

function LogInForm() {

    const [username, setUsername] = React.useState("");
    const [password, setPassword] = React.useState("");

    function handleUsernameChange(event) {
        var username = event.target.value;
        setUsername(username);
        console.log(username);
    }

    function handlePasswordChange(event) {
        var password = event.target.value;
        setPassword(password);
        console.log(password);
    }



    return (
        <div className="container-login" id="container-login" >
            <Heading headingText="Log In" />
            <form>
                <div className="form-group">
                    <Input onChange={handleUsernameChange} type="text" placeholder="Username" />
                </div>
                <div className="form-group">
                    <Input onChange={handleUsernameChange} type="password" placeholder="Password" />
                </div>
                <button type="submit" className="submit-button">Log In</button>
            </form>
        </div>
    );
}
